import React from 'react';

function ListingCard() {
  return (
    <div className="card" style={{ border: '1px solid #ccc', borderRadius: '5px', padding: '10px', margin: '10px', width: '200px' }}>
      <div className="card-img-top" style={{ width: '100%', height: '150px', backgroundColor: '#f0f0f0' }}></div>
      <div className="card-body">
        <h5 className="card-title" style={{ marginBottom: '8px', height: '20px', backgroundColor: '#f0f0f0' }}></h5>
        <p className="card-text" style={{ marginBottom: '0', height: '15px', backgroundColor: '#f0f0f0' }}></p>
      </div>
    </div>
  );
};

export default ListingCard;
